INSERT INTO `products` (`id`, `name`, `small_description`, `description`, `price`, `quantity`, `category_id`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 'CAT LITTER', 'CAT LITTER offers premium, low-dust litter with powerful odor control for a cleaner, fresher home.', 'CAT LITTER is a trusted brand committed to providing premium cat litter solutions that meet the needs of both pets and their owners. Our formulas are crafted for maximum odor absorption, keeping your home fresh while maintaining a low-dust and hypoallergenic environment that\'s gentle on sensitive paws and respiratory systems. CAT LITTER offers a variety of types, including clumping, non-clumping, and natural, ensuring a perfect fit for any lifestyle. With easy maintenance and superior odor control, CAT LITTER is designed to make cleaning the litter box simple, allowing you more time to enjoy with your furry friend. Join thousands of satisfied cat owners who trust CAT LITTER to deliver quality and peace of mind with every scoop.', 4.99, 100, 4, NULL, '2024-10-27 23:11:22', '2024-11-04 10:14:11'),
(5, 'Purrfect Rest', 'Cozy and supportive, this pet bed is designed to give your pet a comfortable and restful place to sleep.', 'This luxurious pet bed is crafted with premium, soft materials to create a cozy and inviting space where your pet can relax and recharge. Featuring a plush, cushioned surface and supportive raised edges, it provides both comfort and security for pets who love to curl up. The non-slip bottom ensures the bed stays in place, while the removable, machine-washable cover makes cleaning a breeze. Ideal for any pet, this bed blends seamlessly into any home décor, offering a stylish and functional addition to your space. Treat your pet to ultimate relaxation with a bed designed just for them', 15.50, 70, 11, NULL, '2024-10-27 23:11:22', '2024-11-04 07:07:52'),
(7, 'Instinct', 'Instinct Cat Food offers high-quality, grain-free nutrition made with real meat and fresh ingredients. Packed with protein and essential nutrients, it promotes healthy digestion and supports overall well-being in cats of all life stages.', 'Instinct Cat Food is a premium, grain-free option that prioritizes your cat\'s health and vitality. Crafted with real, high-quality meat as the first ingredient, this cat food provides the essential protein cats need for strong muscles and a healthy lifestyle. The blend includes a variety of fresh fruits and vegetables, offering a rich source of vitamins and minerals to support overall wellness.\r\n\r\nInstinct\'s unique raw coating enhances flavor and palatability, ensuring your cat enjoys every bite. With a focus on natural ingredients and balanced nutrition, Instinct is suitable for cats of all ages, promoting healthy digestion and a shiny coat. Whether you’re feeding a playful kitten or a seasoned adult cat, Instinct Cat Food is designed to meet their nutritional needs and support their instinctual behaviors. Choose Instinct for a diet that mirrors the ancestral diet of cats, keeping them happy and thriving', 7.99, 86, 2, NULL, '2024-10-27 23:11:22', '2024-11-04 10:14:21'),
(11, 'PawPerfect Collars', 'PawPerfect Collars combine style and comfort, crafted from durable materials with adjustable designs for a perfect fit. Available in various colors and patterns, they ensure your pet looks great while staying secure during walks', 'PawPerfect Collars are the ultimate blend of style, safety, and comfort for your beloved pets. Made from high-quality, durable materials, these collars are designed to withstand everyday wear while providing a secure fit. The adjustable design allows for easy customization, ensuring your pet is comfortable and secure.\r\n\r\nAvailable in a wide range of vibrant colors and unique patterns, PawPerfect Collars let you express your pet\'s personality while keeping them safe. Each collar features a sturdy D-ring for attaching ID tags and leashes, making it ideal for walks, training, or playtime. With PawPerfect Collars, you can trust that your furry friend will not only look fabulous but also be safe and secure on every adventure', 0.99, 30, 6, NULL, '2024-10-28 21:58:09', '2024-11-04 07:16:44'),
(12, 'Purrfect Litter Box', 'The Purrfect Clean Litter Box features a high-sided design to prevent spills and a discreet cover for privacy. Its easy-to-clean surface and odor-control technology make it a practical choice for maintaining a fresh and tidy space for your cat', 'The Purrfect Clean Litter Box is designed to provide your feline friend with the ultimate bathroom experience while keeping your home clean and odor-free. Featuring a high-sided design, this litter box effectively prevents spills and litter scatter, ensuring that your floors remain tidy. The discreet cover offers your cat the privacy they desire while also containing odors for a more pleasant environment.\r\n\r\nConstructed from durable, easy-to-clean materials, the Purrfect Clean Litter Box makes maintenance a breeze. Its smooth surface allows for quick scooping and hassle-free cleaning, so you can spend more time enjoying your cat\'s company. The built-in odor-control technology neutralizes unpleasant smells, keeping your home fresh and inviting. Suitable for cats of all sizes, the Purrfect Clean Litter Box is the ideal solution for any cat owner looking to balance functionality with style', 15.75, 40, 4, NULL, '2024-10-28 21:59:18', '2024-11-04 10:14:28'),
(13, 'LindoCat', 'LindoCat Premium Cat Litter offers superior odor control and exceptional clumping abilities, ensuring a clean and fresh environment for your feline friend. Made from natural, biodegradable materials, it\'s safe for both cats and the planet.', 'LindoCat Premium Cat Litter is the ultimate choice for cat owners who value cleanliness, comfort, and sustainability. Formulated with advanced clumping technology, this litter quickly absorbs moisture and forms tight clumps, making scooping effortless and efficient. Say goodbye to unpleasant odors—LindoCat\'s superior odor control keeps your home smelling fresh, even between cleanings.\r\n\r\nCrafted from natural, biodegradable materials, LindoCat is gentle on your cat’s paws and safe for the environment. Its dust-free formula minimizes mess and promotes better air quality, making it ideal for both you and your feline companion. With LindoCat, you can provide a comfortable and hygienic litter experience, while also making an eco-friendly choice.\r\n\r\nAvailable in various package sizes, LindoCat Premium Cat Litter is perfect for multi-cat households or single-cat families. Choose LindoCat for a cleaner, fresher, and more sustainable litter solution that both you and your cat will love', 2.99, 65, 4, NULL, '2024-10-28 21:59:40', '2024-11-04 07:31:33'),
(14, 'CozyNest Bed', 'Let your pet rest in ultimate comfort with the CozyNest Bed—perfect for cozy naps and relaxation', 'The SnuggleSpot Pet Bed is the ultimate in comfort and relaxation, offering your furry friend a soft and supportive place to rest. Crafted with premium, ultra-soft materials, this bed is designed to provide a cozy haven that feels safe and warm. The bed’s high bolster edges provide a sense of security, perfect for pets who love to curl up or lean against something soft while they nap.\r\n\r\nThe SnuggleSpot features a plush, cushioned base that helps alleviate pressure on joints, making it an ideal choice for both young pets who need a comfortable spot after playtime and senior pets needing extra support. Its durable, machine-washable cover is designed for easy maintenance, ensuring it stays fresh and clean for your pet’s next nap.\r\n\r\nPerfectly sized to fit any corner of your home, SnuggleSpot Pet Bed blends function with style, seamlessly fitting into any room’s decor. Whether it’s after a playful day or simply a place to lounge, this bed offers a level of comfort that pets love and owners trust. Give your pet the gift of relaxation with the SnuggleSpot Pet Bed—their new favorite place to rest', 12.99, 45, 11, NULL, '2024-10-28 22:01:27', '2024-11-04 07:08:44'),
(15, 'Friskies', 'Friskies Savory Delights Cat Food features a delicious blend of real meat, wholesome grains, and garden-fresh vegetables.', 'Friskies Savory Delights Cat Food is specially crafted to satisfy your cat\'s cravings and nourish their well-being. Made with real meat as the primary ingredient, this delightful cat food is combined with wholesome grains and a variety of garden-fresh vegetables, creating a flavorful meal your feline friend will love.\r\n\r\nEach serving is packed with essential vitamins and minerals, providing complete and balanced nutrition for cats of all ages, from playful kittens to mature adults. The diverse flavors and textures ensure that every meal is a delightful experience, encouraging healthy eating habits and maintaining a happy appetite.\r\n\r\nFriskies understands that cats are more than pets—they\'re family. That’s why this cat food is formulated to support your cat’s overall health, promoting strong muscles, healthy digestion, and a shiny coat. Treat your beloved feline to Friskies Savory Delights, where taste meets nutrition for a truly purr-fect meal!', 3.25, 110, 2, NULL, '2024-10-28 22:02:21', '2024-11-04 07:37:46'),
(16, 'Feline Fun Toys', 'Feline Fun Toys provide engaging and interactive play for your cat. Crafted from safe materials, these toys stimulate natural instincts and promote healthy activity for a happier, more active feline companion', 'Feline Fun Toys are designed to captivate and entertain your furry friend, offering a variety of options to satisfy their playful nature. Made from safe, durable materials, these toys encourage exercise and exploration, ensuring your cat stays happy and healthy.\r\n\r\nFrom feather wands that inspire pouncing and chasing to plush toys perfect for cuddling, Feline Fun Toys cater to every cat\'s play style. Each toy is thoughtfully designed to stimulate natural instincts, promoting both mental and physical activity that is essential for your cat\'s well-being.\r\n\r\nWith Feline Fun Toys, you can create unforgettable playtime moments that strengthen the bond between you and your pet. Give your cat the gift of fun and adventure, and watch as they leap, bat, and explore, making every day a joyful experience!', 3.50, 25, 13, NULL, '2024-10-28 22:03:06', '2024-11-04 07:39:34'),
(17, 'CHOPPED GROUND DINNER', 'Chopped Ground Delight Cat Food is a savory blend of high-quality proteins and wholesome ingredients, providing a complete and balanced meal for your feline friend', 'Chopped Ground Delight Cat Food is designed to cater to your cat\'s natural cravings while delivering complete and balanced nutrition. Made with high-quality proteins, this delicious cat food features a finely chopped texture that is easy for cats to eat and digest. The savory blend of real meat and wholesome ingredients ensures that every meal is both satisfying and nourishing.\r\n\r\nRich in essential vitamins and minerals, Chopped Ground Delight supports your cat’s overall health, promoting strong muscles, a shiny coat, and optimal energy levels. Ideal for cats of all ages, this food is perfect for both kittens and adult cats, providing the essential nutrients they need for a healthy, active lifestyle.\r\n\r\nWith its mouthwatering taste and appealing texture, Chopped Ground Delight Cat Food is sure to please even the pickiest of eaters. Treat your furry companion to a meal they’ll love while ensuring they receive the nutrition they deserve with every serving!', 2.75, 150, 2, NULL, '2024-10-28 22:09:48', '2024-11-04 07:48:48'),
(18, 'WhiskerWize', 'The WhiskerWize Litter Box is designed for easy access and maintenance, featuring a spacious interior and a removable tray for quick cleaning. Its advanced odor control keeps your home fresh while providing your cat with a comfortable and private space', 'The WhiskerWize Litter Box combines convenience and comfort, making it an essential addition to any cat owner\'s home. With its spacious interior, this litter box allows for easy movement and digging, catering to your cat’s natural instincts. The removable tray simplifies the cleaning process, making it easy to maintain a hygienic environment for your feline friend.\r\n\r\nEquipped with advanced odor control technology, the WhiskerWize Litter Box effectively neutralizes smells, ensuring your living space remains fresh and inviting. Its sleek design fits seamlessly into any decor, while the low entry point provides easy access for cats of all ages, including kittens and seniors.\r\n\r\nWhether you have one cat or several, the WhiskerWize Litter Box is designed to meet their needs while making your life easier. Choose WhiskerWize for a litter box that prioritizes comfort, cleanliness, and style', 11.99, 55, 4, NULL, '2024-10-28 22:11:00', '2024-11-04 07:23:44'),
(20, 'COCONUT CAT LITTER', 'Coconut Cat Litter is an eco-friendly, biodegradable litter made from natural coconut fibers. With excellent odor control and superior clumping abilities, it provides a clean, comfortable environment', 'Coconut Cat Litter is a revolutionary, eco-friendly alternative to traditional cat litter, crafted from natural coconut fibers. This biodegradable litter offers exceptional clumping properties, making it easy to scoop and maintain a clean litter box. Its unique formula effectively absorbs moisture and neutralizes odors, keeping your home smelling fresh while providing a comfortable space for your feline friend.\r\n\r\nThe lightweight nature of Coconut Cat Litter makes it easy to handle and pour, while its soft texture is gentle on your cat’s paws, encouraging them to use it comfortably. Suitable for cats of all ages, this litter is not only good for your pet but also kind to the environment, as it is made from renewable resources.\r\n\r\nBy choosing Coconut Cat Litter, you’re opting for a sustainable and effective solution that prioritizes your cat’s health and well-being. Give your furry companion a cleaner, fresher litter experience with the natural benefits of coconut!', 3.75, 100, 4, NULL, '2024-11-03 14:06:51', '2024-11-04 07:52:51'),
