INSERT INTO `services` (`id`, `name`, `small_description`, `description`, `price`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 'Vaccine', 'Quo excepturi ea voluptatibus aut qui expedita possimus.', 'Vaccinations are essential to protect your pets from various contagious diseases. At PawClinic, we offer a comprehensive vaccination program tailored to your pet\'s specific needs. Our expert veterinarians use the latest vaccines to ensure maximum protection and effectiveness. Regular immunizations not only safeguard your pets but also contribute to a healthier community by preventing the spread of diseases. Ensure your furry friends stay healthy and safe with our trusted vaccination services', 74.83, NULL, '2024-10-27 23:11:22', '2024-10-27 23:14:51'),
(2, 'Grooming', 'Molestias corporis molestias corrupti dolorem sed.', 'At PawClinic, we provide professional grooming services to keep your pets looking and feeling their best. Our experienced groomers offer a full range of services, including bathing, haircuts, nail trimming, and ear cleaning. Regular grooming helps maintain your pet’s coat health, reduces shedding, and prevents matting. It also allows us to check for any skin issues or parasites that may need attention. Treat your furry friend to a pampering session with our gentle and caring team.', 470.96, NULL, '2024-10-27 23:11:22', '2024-10-27 23:15:29'),
(3, 'Surgery', 'Et incidunt qui voluptas aspernatur.', 'At PawClinic, our skilled veterinary surgeons provide a wide range of surgical services with the utmost care and precision. From routine procedures like spaying and neutering to more complex surgeries, our team is equipped to handle it all. We use advanced surgical techniques and state-of-the-art equipment to ensure the safety and comfort of your pets. Our dedicated staff closely monitors each patient before, during, and after surgery to provide comprehensive care. Trust PawClinic for expert surgical solutions to keep your pets healthy and thriving.', 161.11, NULL, '2024-10-27 23:11:22', '2024-10-27 23:15:54'),
(4, 'Dental', 'Et quia eos eum eum accusantium.', 'At PawClinic, we prioritize your pet\'s dental health with comprehensive dental care services. Regular dental check-ups and cleanings are essential to prevent plaque buildup, gum disease, and tooth decay. Our skilled veterinarians use advanced tools and techniques to ensure your pet’s teeth and gums remain healthy. We also provide dental treatments and surgeries for more serious issues, ensuring your pet receives the best possible care. Keep your furry friend\'s smile bright and their overall health in top shape with our expert dental services.', 168.37, NULL, '2024-10-27 23:11:22', '2024-10-27 23:16:15'),
(5, 'Wellness care', 'Aut ab laborum quaerat et.', 'At PawClinic, we offer comprehensive wellness care to ensure your pets lead healthy, happy lives. Our wellness programs include regular check-ups, vaccinations, parasite prevention, and nutritional counseling tailored to your pet\'s specific needs. Early detection and preventive care are key to maintaining your pet’s health and catching potential issues before they become serious. Our dedicated team provides personalized care plans to support your pet at every life stage. Trust PawClinic for proactive and compassionate wellness care to keep your pets thriving.', 490.75, NULL, '2024-10-27 23:11:22', '2024-10-27 23:16:39'),
(6, 'Pet Boarding', 'Rerum voluptatem ipsum dignissimos aut.', 'At PawClinic, we offer top-notch pet boarding services to provide a safe and comfortable home away from home for your furry friends. Our facility is equipped with clean, spacious accommodations and plenty of playtime to keep your pets happy and engaged. Our experienced staff ensures each pet receives personalized attention, regular exercise, and proper nutrition. We monitor your pet\'s health and well-being closely to ensure they stay safe and content during their stay. Trust PawClinic for a worry-free boarding experience, knowing your pets are in caring hands.', 111.46, NULL, '2024-10-27 23:11:22', '2024-10-27 23:16:59'),
(7, 'est', 'Nemo et quas tenetur aspernatur suscipit.', 'Nemo iste fuga non tenetur consequuntur eligendi.', 197.16, '2024-10-27 23:17:04', '2024-10-27 23:11:22', '2024-10-27 23:17:04'),
